import React from 'react';
import { Link } from 'react-router-dom';
import "../../styles/styles.scss";

const RatingAndDistance = (props) => {
  return (
    <div className="container-horizontal">
      <div className="container-verical rating-distance-contai">
        <p className="normal-text gray-color-text">Deliver</p>
        <p className="bold-text-regular">21 min</p>
      </div>

      <div className="container-verical">
        <p className="normal-text gray-color-text">Minimum</p>
        <p className="bold-text-regular">20k</p>
      </div>

      <div className="container-verical">
        <p className="normal-text gray-color-text">Rating</p>
        <p className="bold-text-regular">4.5</p>
      </div>

      <div className="container-verical">
        <p className="normal-text gray-color-text">More</p>
        <p className="bold-text-regular">4.5</p>
      </div>
    </div>
  )
}

export default RatingAndDistance;
